import React, { useEffect } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


interface NavigationI {
    title:string,
    path:string  ,
    com:any
}

interface NavigationProps{
    data:NavigationI[];
}


const Navigation: React.FC<NavigationProps> = ({ data }: NavigationProps) => {
    return (
        <Router>
            <div>
                <ul>
                    {data.map((item,index) => {
                        return (
                            <li key={index}>
                                <Link to={item.path}>{item.title} {index}</Link>
                            </li>
                        )
                    })}
                </ul>
                <Routes>
                {data.map((item) => {
                    return(
                    <Route path={item.path} element={<item.com/>} />
                    )
                })}
                </Routes>
            </div>
        </Router>
    )
}

export default Navigation;
